import React, {Component, Fragment} from "react";

class Personnages extends React.Component {
    render() {
        return (
        <>
        <header>Bonjour !</header>
        <h2>Je suis Lala, j'ai 3 ans</h2>
        <h2>Moi c'est Po et j'ai 4 ans</h2>
        <h2>Moi c'est Tipsy et j'ai 2 ans 1/2</h2>
        </>
        );
    }
}

export default Personnages;
